rchaseMusic":"","urlOfficialWebsite":"","urlMySpace":"","urlFacebook":"","urlTwitter":"","twitterScreenName":""}],"supports":[{"id":693313,"name":"Matpat","startTime":null,"eventDescription":"At a young age, Matthew Patrick Dodd was introduced to an eclectic mix of music from his family that would later be inspiration for his own burgeoning take on Electronic Music. By seven, his brother had him standing on milk crates so he could reach his first set of tables and by thirteen, he had already started playing classic records like Kraftwerk's "Tour De France" and Hard Drive's "Deep Inside."

Matpat's sound is influenced by the producers that came before him. Detroit Techno, Chicago House and Disco from Philadelphia & New York (as well as his own productions) fill his DJ sets and have begun to distinguished him as a House Music Maven. His "Crush" EP was picked up by Terry Farley, the man behind Junior Boys Own. Mat's release on Stretch Armstrong's New York Dance Label, Plant Music received a 4/5 on Resident Advisor. Then he signed to Derrick Carter's label Persnickety for "The Chicago-Philly Combo" (which reached the Juno Records Top 5 Singles Chart and sold out). All this helped solidify Matpat as a house music DJ and Producer with a promising future.

